const Nav = () => {
  return (
    <ul className="bg-warning">
      <li>
        <a href="/">Home</a>
      </li>
      <li>
        <a href="/instructors">Instructors</a>
      </li>
      <li>
        <a href="/contact">Contact</a>
      </li>
    </ul>
  );
};

export default Nav;
